EasyFilter&lt;?php ini_set(&quot;open_basedir&quot;,&quot;./&quot;); if(!isset($_GET[&#x27;action&#x27;]))&#123; highlight_file(__FILE__); die(); &#125; if($_GET[&#x27;action&#x27;] == &#x27;w&#x27;)&#123; @mkdir(&quot;./files/&quot;); $content = $_GET[&#x27;c&#x27;]; $file = bin2hex(random_bytes(5)); file_put_contents(&quot;./files/&quot;.$file,base64_encode($content)); echo &quot;./files/&quot;.$file; &#125;elseif($_GET[&#x27;action&#x27;] == &#x27;r&#x27;)&#123; $r = $_GET[&#x27;r&#x27;]; $file = &quot;./files/&quot;.$r; include(&quot;php://filter/resource=$file&quot;); &#125;
首先题目使用了open_basedir，设定了只能访问当前目录的文件 ini_set(&quot;open_basedir&quot;,&quot;./&quot;);
这里我们可以在一个文件里写入php代码来绕过，比如我们在一个文件里写入 &lt;?php echo system(&#x27;ls /&#x27;);?&gt;
我们再访问这个文件，是不是就可以直接查看根目录，这题就是类似的思路 下面就是有2种模式，一种是action&#x3D;w时，他首先会创建一个files目录 @mkdir(&quot;./files/&quot;);
然后将创建一个随机的5位字符，16进制加密后给file，你可以理解这是将文件名加密了 string random_bytes(int $length)
生成适合于加密使用的任意长度的加密随机字节字符串，例如在生成salt、密钥或初始化向量，bin2hex() 函数把 ASCII 字符的字符串转换为十六进制值 $file = bin2hex(random_bytes(5));
然后将我们写入的东西，base64加密后传入.&#x2F;files&#x2F;filename中，再返回到屏幕上 file_put_contents(&quot;./files/&quot;.$file,base64_encode($content));echo &quot;./files/&quot;.$file;
第一种是写，第二种就是读了，这里读的话，就是直接读，不用base64加密 elseif($_GET[&#x27;action&#x27;] == &#x27;r&#x27;)&#123; $r = $_GET[&#x27;r&#x27;]; $file = &quot;./files/&quot;.$r; include(&quot;php://filter/resource=$file&quot;); &#125;
我们常见的php伪协议读数据的方法是 php://filter/read=convert.base64-encode/resource=file
他这里给的是 php://filter/resource=file
他省略了encode加密的过程，我们写的时候是不是将文件的内容进行base64加密后再传入文件，这样我们的php代码就直接会成为base64密文，并不会作为php代码执行，我们在文件包含的时候将其解密，他就会变成php代码执行了 php://filter/resource=./files/read=convert.base64-decode/resource=file
